import React, { FC, useState, useEffect } from 'react';
import './App.css';
import Search from '../searchnum/searchnum'
import PaginaCards from '../pca/pca'
import ButtonComponent from '../ButtonMap/ButtonMap';
import SvgMap from '../SVGMap/SVGMap';
import styled from 'styled-components';

const AppWrapper = styled.div`
  position: relative;
  min-height: 100vh;
`;

interface Car {
  comments: string[];
  digits: string;
  is_stolen: boolean;
  model: string;
  model_year: number;
  operations: Array<any>;
  photo_url: string;
  region: {
    name: string;
    name_ua: string;
    slug: string;
    old_code: string;
    new_code: string;
  };
  stolen_details: any;
  vendor: string;
  vin: string;
}

interface Region {
  id: string;
  color: string;
}


function App() {
  const [modalIsOpen, setModalIsOpen] = useState<boolean>(false);
  const [regions, setRegions] = useState<Region[]>([]);
  const [carData, setCarData] = useState<Car | null | string>(null);
  const [Searchnomer, setNomer] = useState<string>(" ");

  const handleButtonClick = () => {
    setModalIsOpen(true);
  };
  
  const closeModal = () => {
    setModalIsOpen(false);
  };

  console.log(carData);

  return (
    <AppWrapper>
      <div className="background"></div>
      <Search setDataFromSearch={setCarData} setNomer={setNomer} />
      <PaginaCards car={carData} nomer={Searchnomer} />
      <ButtonComponent onClick={handleButtonClick} />
      <SvgMap isOpen={modalIsOpen} onClose={closeModal} regions={regions} />
    </AppWrapper>
  );
}

export default App;
